import { makeStyles } from '@material-ui/core/styles'

export const useStyles = makeStyles(theme => ({
  root: {
    background: '#fff',
    zIndex: 1,
    '&:hover': {
      backgroundColor: '#fafafa'
    }
  },
  overFlowText: {
    textOverflow: 'ellipsis',
    overflow: 'hidden'
  }
}))
